import React from 'react';
import './playercontrols.css';
import ProgressiveBar from '../progress_bar/progressive_bar';


class PlayerControls extends React.Component {
    render() {
        return(
            <div className='playercontrols'>
                <div className='player-controls'>
                    <div className='player-controls__buttons'>
                        <div><i className="material-icons">skip_previous</i></div>
                        <div onClick={this.props.onClick}><i className="material-icons md-38">play_circle_outline</i></div>
                        <div><i className="material-icons">skip_next</i></div>
                    </div>
                    <div className='player-controls__progress_bar_time'>
                        <div>0:00</div>
                        <ProgressiveBar percent={this.props.percent}/>
                        <div>4:34</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default PlayerControls;
